import "./Login.scss";
import "./Responsive.scss";

import { LoginOutlined, BorderTopOutlined } from "@ant-design/icons";
import { Button, Checkbox, Col, Form, Input, Row, notification } from "antd";
import type { NotificationPlacement } from "antd/es/notification/interface";
import axios from "axios";
import React from "react";
import { Link, Navigate, Route, Routes, useNavigate } from "react-router-dom";

function Login() {
  const [api, contextHolder] = notification.useNotification();

  const openNotification = (placement: NotificationPlacement) => {
    api.info({
      message: `Thong bao dang nhap`,
      description: "Dang nhap thanh cong",
      placement,
    });
  };

  // const onFinish = (values: any) => {
  //   console.log("Success:", values);
  //   axios
  //     .post("http://192.168.2.224:9099/api/auth/signin", values)
  //     .then((data) => {
  //       const accessToken = data.data.data.token;
  //       const status = data.status;
  //       console.log(data);
  //       localStorage.setItem("access_token", accessToken);

  //       checkToken(localStorage.getItem("access_token") || "{}");
  //     });
  // };

  // const checkToken = (token: string) => {
  //   token
  //     ? (window.location.href = "/HomePage")
  //     : console.log("Token does not exist");
  // };

  // const onFinishFailed = (errorInfo: any) => {
  //   console.log("Failed:", errorInfo);
  // };

  let navigate = useNavigate();

  const form = useHref();
  const checkBtn = useRef();

  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [loading, setLoading] = useState(false);

  const { isLoggedIn } = useSelector(state => state.auth);
  const { message } = useSelector(state => state.message);

  const dispatch = useDispatch();

  const onChangeUsername = (e) => {
    const username = e.target.value;
    setUsername(username);
  };

  const onChangePassword = (e) => {
    const password = e.target.value;
    setPassword(password);
  };

  const handleLogin = (e) => {
    e.preventDefault();

    setLoading(true);

    form.current.validateAll();

    if (checkBtn.current.context._errors.length === 0) {
      dispatch(login(username, password))
        .then(() => {
          navigate("/profile");
          window.location.reload();
        })
        .catch(() => {
          setLoading(false);
        });
    } else {
      setLoading(false);
    }
  };

  if (isLoggedIn) {
    return <Navigate to="/profile" />;
  }

  return (
    <div className="App">
      <Row style={{ height: "100%" }}>
        <Col span={12} xs={24} sm={12}>
          <div className="register register-left">
            <div className="title">
              <img
                src="https://cdn.haitrieu.com/wp-content/uploads/2022/06/Logo-Thanh-Pho-Da-Nang.png"
                alt="logo DA NANG city"
              />
              <h2>KHO KẾT QUẢ THỦ TỤC HÀNH CHÍNH SỐ</h2>
            </div>

            <Form
              name="basic"
              labelCol={{ span: 24 }}
              wrapperCol={{ span: 0 }}
              style={{ maxWidth: 600 }}
              initialValues={{ remember: true }}
              onFinish={onFinish}
              onFinishFailed={onFinishFailed}
              autoComplete="off"
            >
              <Form.Item
                label="Tên đăng nhập"
                name="username"
                rules={[
                  { required: true, message: "Vui lòng nhập tên đăng nhập!" },
                ]}
              >
                <Input />
              </Form.Item>

              <Form.Item
                label="Mật khẩu"
                name="password"
                rules={[{ required: true, message: "Vui lòng nhập mật khẩu!" }]}
              >
                <Input.Password />
              </Form.Item>

              <Form.Item
                name="remember"
                valuePropName="checked"
                wrapperCol={{ offset: 0, span: 11 }}
              >
                <Checkbox>Remember me</Checkbox>
              </Form.Item>

              <Form.Item wrapperCol={{ offset: 0, span: 0 }}>
                {contextHolder}
                <Button
                  type="primary"
                  htmlType="submit"
                  style={{ width: "100%" }}
                  onClick={(e) => {
                    openNotification("top");
                    checkToken("");
                  }}
                >
                  <LoginOutlined />
                  Đăng nhập
                </Button>
              </Form.Item>
              <Form.Item wrapperCol={{ offset: 0, span: 0 }}>
                <Button
                  htmlType="submit"
                  style={{
                    width: "100%",
                    backgroundColor: "#ff8f18",
                  }}
                  type="primary"
                >
                  Đăng nhập bằng tài khoản công dân số
                </Button>
              </Form.Item>
            </Form>
          </div>
        </Col>
        <Col span={12} xs={24} sm={12} className="col-right">
          <div className="register register-right"></div>
        </Col>
      </Row>
    </div>
  );

  function newFunction() {
    const [api, contextHolder] = notification.useNotification();
    const Context = React.createContext({ name: "Default" });
    const openNotification = (placement: NotificationPlacement) => {
      api.info({
        message: `Notification ${placement}`,
        description: (
          <Context.Consumer>{({ name }) => `Hello, ${name}!`}</Context.Consumer>
        ),
        placement,
      });
    };
    return openNotification;
  }
}

export default Login;
